import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";

// ✅ Admin Pages
import AdminLogin from "./pages/admin/AdminLogin";
import Dashboard from "./pages/admin/Dashboard";
import CourseList from "./pages/admin/CourseList";
import AddCourse from "./pages/admin/AddCourse";
import AddLecture from "./pages/admin/AddLecture";
import InstructorList from "./pages/admin/InstructorList";

// ✅ Instructor Pages
import InstructorLogin from "./pages/instructor/InstructorLogin";
import MyLectures from "./pages/instructor/MyLectures";

// ✅ Components
import ProtectedRoute from "./components/ProtectedRoute";

function App() {
  return (
    <Router>
      <Routes>
        {/* Admin Routes */}
        <Route path="/admin/login" element={<AdminLogin />} />
        <Route
          path="/admin/dashboard"
          element={
            <ProtectedRoute>
              <Dashboard />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/courses"
          element={
            <ProtectedRoute>
              <CourseList />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/add-course"
          element={
            <ProtectedRoute>
              <AddCourse />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/add-lecture"
          element={
            <ProtectedRoute>
              <AddLecture />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/instructors"
          element={
            <ProtectedRoute>
              <InstructorList />
            </ProtectedRoute>
          }
        />

        {/* Instructor Routes */}
        <Route path="/instructor/login" element={<InstructorLogin />} />
        <Route
          path="/instructor/my-lectures"
          element={
            <ProtectedRoute>
              <MyLectures />
            </ProtectedRoute>
          }
        />

        {/* Redirect any unknown route to admin login */}
        <Route path="*" element={<Navigate to="/admin/login" />} />
      </Routes>
    </Router>
  );
}

export default App;
